import mainImg from '../images/mainImg.png';
import './Header.css';

function Header() {
  return (
    <div className="headerAll">
      <div>
        <p>welcome to</p>
        <h1>DreamBAG</h1>
        <p>동국대학생의 쉼을 꿈꾸는 드림백</p>
      </div>
      <img className="mainImg" src={mainImg} />
    </div>
  );
}

export default Header;
